jQuery(function() {
	initFocus();
	initValidation();
	initSelectMod();
	initDatePicker();
	initDataTables();
	initFixedHeader();
});


function initFixedHeader() {
	$(window).scroll(function()
	{
		if($(this).scrollTop()>50)
		{
			$(".header").addClass("fixed-header")
		}
		else
		{
			$(".header").removeClass("fixed-header")
		}
	})
}


 $(document).on('hidden.bs.modal', function (event) {
 	if ($('.modal:visible').length) {
 		$('body').addClass('modal-open');
 	}
 });

 function initDatePicker() {

 	$('input.date-pick').daterangepicker({
 		opens: 'left'
 	}, function(start, end, label) {
 		console.log("A new date selection was made: " + start.format('YYYY-MMMM-DD') + ' to ' + end.format('YYYY-MMMM-DD'));
 		$('.start-date .date-day').html(start.format('D'));
 		$('.start-date .date-month').html(start.format('MMM'));
 		$('.start-date .year').html(start.format('YYYY'));

 		$('.end-date .date-day').html(end.format('D'));
 		$('.end-date .date-month').html(end.format('MMM'));
 		$('.end-date .year').html(end.format('YYYY'));
 	});
 };

 jQuery(function() {
 	function readURL(input) {
 		if (input.files && input.files[0]) {
 			var reader = new FileReader();
 			reader.onload = function(e) {
 				var imagePreview = jQuery('#imagePreview');
 				var imgPrev = jQuery('#imgPrev');
 				if(imagePreview){
 					$('#imagePreview').css('background-image', 'url('+e.target.result +')');
 					$('#imagePreview').hide();
 					$('#imagePreview').fadeIn(650);
 				}
 			}
 			reader.readAsDataURL(input.files[0]);
 		}
 	}
 	$("#imageUpload").change(function() {
 		readURL(this);
 	});
 });

 function ShowPassword() {
 	var x = document.getElementById("login-pw");
 	if (x.type === "password") {
 		x.type = "text";
 	} else {
 		x.type = "password";
 	}
 }

 function initFocus() {
 	var input = jQuery('.focus-control');
 	var hasValue = jQuery('.focus-control.has-value');
 	if(hasValue.val()) {
 		hasValue.addClass('in-focus');
 	}
 	input.blur(function() {
 		if($(this).val().length) {
 			$(this).addClass('in-focus');
 		} else {
 			$(this).removeClass('in-focus');
 		}
 	})
 }

 function initValidation() {
 	'use strict';
 	window.addEventListener('load', function() {
 		var forms = document.getElementsByClassName('needs-validation');
 		var validation = Array.prototype.filter.call(forms, function(form) {
 			form.addEventListener('submit', function(event) {
 				if (form.checkValidity() === false) {
 					event.preventDefault();
 					event.stopPropagation();
 				}
 				form.classList.add('was-validated');
 			}, false);
 		});
 	}, false);
 }

 function initSelectMod() {
 	var x, i, j, selElmnt, a, b, c;
 	x = document.getElementsByClassName("select-wrap");
 	for (i = 0; i < x.length; i++) {
 		selElmnt = x[i].getElementsByTagName("select")[0];
 		a = document.createElement("DIV");
 		a.setAttribute("class", "select-selected");
 		a.innerHTML = selElmnt.options[selElmnt.selectedIndex].innerHTML;
 		x[i].appendChild(a);
 		b = document.createElement("DIV");
 		b.setAttribute("class", "select-items select-hide");
 		for (j = 1; j < selElmnt.length; j++) {
 			c = document.createElement("DIV");
 			c.innerHTML = selElmnt.options[j].innerHTML;
 			c.addEventListener("click", function(e) {
 				var y, i, k, s, h;
 				s = this.parentNode.parentNode.getElementsByTagName("select")[0];
 				h = this.parentNode.previousSibling;
 				for (i = 0; i < s.length; i++) {
 					if (s.options[i].innerHTML == this.innerHTML) {
 						s.selectedIndex = i;
 						h.innerHTML = this.innerHTML;
 						y = this.parentNode.getElementsByClassName("same-as-selected");
 						for (k = 0; k < y.length; k++) {
 							y[k].removeAttribute("class");
 						}
 						this.setAttribute("class", "same-as-selected");
 						break;
 					}
 				}
 				h.click();
 			});
 			b.appendChild(c);
 		}
 		x[i].appendChild(b);
 		a.addEventListener("click", function(e) {
 			e.stopPropagation();
 			closeAllSelect(this);
 			this.nextSibling.classList.toggle("select-hide");
 			this.classList.toggle("select-arrow-active");
 		});
 	}

 	function closeAllSelect(elmnt) {
 		var x, y, i, arrNo = [];
 		x = document.getElementsByClassName("select-items");
 		y = document.getElementsByClassName("select-selected");
 		for (i = 0; i < y.length; i++) {
 			if (elmnt == y[i]) {
 				arrNo.push(i)
 			} else {
 				y[i].classList.remove("select-arrow-active");
 			}
 		}
 		for (i = 0; i < x.length; i++) {
 			if (arrNo.indexOf(i)) {
 				x[i].classList.add("select-hide");
 			}
 		}
 	}
 	document.addEventListener("click", closeAllSelect);
 }

 function initDataTables() {
 	$('.table').DataTable();
 }


